import React from 'react';
import { Icon } from '@iconify/react';

const Footer = () => {
  return (
    <div className='w-full h-full bottom-0 bg-white flex shadow border-t-gray-600 font-lato'>
        <div className='w-full flex justify-around'>
        <Icon icon="ic:round-call" color="#515152" width="20" height="20" />
        <Icon icon="ri:user-line" color="#9c9c9c" width="20" height="20" />
        <div className='w-6 h-6 bg-app-green rounded-full border-4'>
        <Icon icon="mdi:dots-grid" color="white" width="20" height="20" />
        </div>
        <Icon icon="clarity:settings-solid" color="#9c9c9c" width="20" height="20" />
        <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" viewBox="0 0 36 36">
            <path fill="#2ac420" d="M18 11a7 7 0 1 1-7 7a7 7 0 0 1 7-7" class="clr-i-outline clr-i-outline-path-1"/>
            <path fill="#9c9c9c" d="M18 34a16 16 0 1 1 16-16a16 16 0 0 1-16 16m0-30a14 14 0 1 0 14 14A14 14 0 0 0 18 4" class="clr-i-outline clr-i-outline-path-2"/>
            <path fill="none" d="M0 0h36v36H0z"/>
        </svg>
        </div>
    </div>
  );
};

export default Footer;
